// Dependencies.
import React from 'react';

// Component 'AboutMe'.
function AboutMe() {
    return (
        // AboutMe Container.
        <>
            <div id="AboutMe">
                <div id="JumboAbout" class="jumbotron jumbotron-fluid">
                    <div class="container">
                        <div class="row">
                            <div class="col-sm-4">
                                <img id="iamshawn-profile2" className="img-thumbnail" alt="iamshawn2.jpg" src="../../assets/misc/iamshawn2.jpg" />
                            </div>
                            <h2 class="display-4">Shawn Luther</h2>
                        </div>

                        <div class="row">
                            <div class="col-sm">

                                <p class="lead">This is a modified jumbotron that occupies the entire horizontal space of its parent.</p>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </>
    );
}

// Do export.
export default AboutMe;
